import React from "react";
import { ThemeProvider, lightGradient, base } from "../styles/theme";
import {
  Hero,
  Container,
  Header,
  Column,
  Row,
  Subheader
} from "../styles/common";
import Layout from "../components/layouts";

const Process = props => {
  // We believe in doing it right the first time!
  return (
    <Layout>
      <ThemeProvider theme={lightGradient(base)}>
        <Hero>
          <Container>
            <Row>
              <Column cols={2}>
                <Header>
                  Our goal is to increase client revenue and decrease wasteful
                  processes.
                </Header>
                <Subheader>
                  We never stop refining and improving operations, products and
                  services.
                </Subheader>
                The latest technology and proprietary processes are used to
                ensure all charges are captured, documented, submitted and paid.
                We rank in the top 5% in all of the most important MGMA
                benchmarks, and we continue to make strides in the areas of
                accuracy, turnaround time and revenue maximization.
              </Column>
            </Row>
          </Container>
        </Hero>
      </ThemeProvider>
    </Layout>
  );
};
export default Process;
